    [],nt"revision_timestamp": "2016-07-27T22:56:44.318040",nt"name": "windom-wetland-management-district-annual-narrative-report-calendar-year-1991",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Windom
    WMD outlines Refuge accomplishments during the 1991 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    public participation, and research and investigations. Refuge administration is
    outlined; information about personnel, volunteer programs, funding, safety, and
    technical assistance is given. Habitat management is also covered; subjects include
    wetlands, forests, croplands, grasslands, grazing, haying, fire management, and
    private lands. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    and game mammals. The public uses of the Refuge described in this report include
    hunting, fishing, trapping, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about rehabilitation,
    equipment replacement, computer systems, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Refuge brochures and field guides
    are attached.",nt"license_title": "License Not Specified",nt"extras":
